import React from 'react';
import { Card, Segment } from 'semantic-ui-react';
import classes from './Sources.module.css';

const Sources = (props) => (
<div>
<Card>
 <Card.Content>
   <Card.Header>News Sources</Card.Header> 
    <Segment vertical>All Sources</Segment>
    <Segment vertical className={classes.Source} onClick={props.clicked}>{props.src}</Segment>
    <Segment><b><i>Favorites(24)</i></b></Segment>
    </Card.Content> 
</Card>    
</div>
)

export default Sources;
